function Map(){this.container={}}Map.prototype.put=function(a,b){try{if(a!=null&&a!=""){this.container[a]=b}}catch(c){return c}};Map.prototype.get=function(a){try{return this.container[a]}catch(b){return b}};Map.prototype.containsKey=function(a){try{for(var c in this.container){if(c==a){return true}}return false}catch(b){return b}};Map.prototype.containsValue=function(a){try{for(var c in this.container){if(this.container[c]===a){return true}}return false}catch(b){return b}};Map.prototype.remove=function(a){try{delete this.container[a]}catch(b){return b}};Map.prototype.clear=function(){try{delete this.container;this.container={}}catch(a){return a}};Map.prototype.isEmpty=function(){if(this.keyArray().length==0){return true}else{return false}};Map.prototype.size=function(){return this.keyArray().length};Map.prototype.keyArray=function(){var a=new Array();for(var b in this.container){a.push(b)}return a};Map.prototype.valueArray=function(){var a=new Array();var c=this.keyArray();for(var b=0;b<c.length;b++){a.push(this.container[c[b]])}return a};